import React from 'react';
import './TopMenu.css';

class TopMenu extends React.Component {
  
  render() {
    return (
      <div className="menu top">
        <div className="title">
          <span>COOK BOOK</span>
        </div>
        <div className="options">
          <div className="option">
            Sign Up
          </div>
          <div className="option">
            Sign In
          </div>
        </div>
      </div>
    )
  }
}

export default TopMenu;
